import axios from "axios";
import FormData from 'form-data';

export const ApiLogin = (param) => {
    const form_data = new FormData();
    form_data.append('nome', 'luan');
    form_data.append('senha', 'luan13')
    return axios.post('http://indoor.lcprojects.net/api/login.php', {nome:'luan', senha:'123'}, { headers: { 'Content-Type': 'multipart/form-data', 'Accept': '*/*' } })
}
